window.bookSummaryJSON = "<p>With the mystery of the world deepening, John Sutton is running out of time.<br> <br> The apocalypse is approaching as his Doom Points tick up and John is finding it harder and harder to keep it together. His deepening knowledge of magic seems to be helping but as a hidden society creeps out of the shadows, intent on throwing the world into chaos, it may not be enough.<br> <br> The only good news seems to be the new crops springing up on his farm. Balancing his growing relationship with Ellie and the increasing productivity of the farm with the impending destruction of everything he fought for, John has no choice but to step back into the limelight, whether he wants to or not.<br> <br> Adapted from the novel and produced with a full cast of actors, immersive sound effects and cinematic music!<br> <br> Performed by Peter Holdway, Wyn Delano, Jenna Sharpe, Nazia Chaudhry, Christopher Walker, Dawn Ursula, Andrew James Spooner, Robb Moreira, Tanja Milojevic, James Lewis, Christopher Williams, RJ Bayley, Rayner Gabriel, Jonathan Lee Taylor, Elias Khalil, James Konicek, Yasmin Tuazon, Rob McFadyen, Ken Jackson, Karen Novack, Michael John Casey, Emlyn McFarland, Donald Guzzi, Nanette Savard, Earl Fisher, Nick DePinto, Eric Messner, Laura C. Harris, Terence Aselford, Richard Rohan, Danny Gavigan, Lillian Rachel, Nora Achrati, and Bradley Foster Smith.</p>"; 
